import React from "react";
import "./Component22.css";

function Component22(props) {
  const { vector, subtract, vector2 } = props;

  return (
    <div className="component-22">
      <img className="vector16" src={vector} />
      <img className="subtract4" src={subtract} />
      <img className="vector-129" src={vector2} />
    </div>
  );
}

export default Component22;
